css:
@-moz-document domain("installgentoo.com") {
  
  /* Install Gentoo Wiki Grey Theme
   * By Desu
   * V.0.5
   * Mascot: Gentoo Penguin, Kemono Friends
   */

  body {
    position: relative;
  }
  body, #mw-page-base {
    background: #666;
  }
  body, body * {
    font-size: 12px!important;/*everything is 12px*/
    font-family: monospace!important;/*for best results, replace with your favorite bitmap font*/
  }
  input[type="search"] {
    background: #444!important;
    border: 0!important;
    color: #111!important;
  }
  div#simpleSearch {
    background: #444!important;
    border: 0!important;
    height: auto!important;
  }
  div.vectorTabs {
    background: transparent;
  }
  div.vectorTabs ul {
    background: transparent;
  }
  div.vectorTabs ul li,
  div.vectorTabs ul li.selected {
    background: transparent;
  }
  div.vectorTabs ul li span {
    border: 0;
    background: transparent;
  }
  div.vectorTabs li a {
    color: #efefef!important;
  }
  div.vectorTabs li.selected a {
    color: #fff!Important;
  }
  #p-logo {
    position: static;
    float: none;
    top: 0;
  }
  #p-logo, #p-logo a {
    width: 350px;
    height: 479px;
  }
  div#mw-panel div.portal {
    width: 349px!important;
    border: 1px solid #555;
    margin: 0 5px 1px 5px!important;
    padding: 0!important;
    background: #555;
    background-image: none!important;
    text-align: right;
  }
  #p-navigation .body, #p-tb .body {
  }
  div#mw-panel {
    color: #D3D3D3;
    width: 350px;
    position: fixed;
    top: 0;
    padding: 0;
  }
  div#mw-panel *, div#mw-head *, #footer * {
    color: #D3D3D3!important;
  }
  #left-navigation {
    margin-left: 360px;
  }
  .mw-body {
    margin-left: 360px;
    background: #ccc;
    border-color: #555;
  }
  #footer {
    margin-left: 350px!important;
  }
  /*begin base64 mascot*/
  #p-logo a {
    background:  url('data:image/png;base64,') top left no-repeat;
  }
 }
